　夜間の安全対策に！通学、塾通い、買い物、散歩…などの夜道に安心。<br>
車のライトなどに反射して光って知らせる安心シールです。<br><br>

・油性ペンでおなまえを書くことができるから、夜間だけでなく日中はおなまえシールとしても活躍します！<br>
・好きなシールを好きなレイアウトで貼るだけだから、ランドセルのほか、帽子や自転車など、さまざまなものに対応できます！<br>
◇パッケージサイズ：横6.3×縦19.5cm<br><br>

